import React from "react";
import { NavLink } from "react-router-dom";

const NavBar = () => {
  return (
    <div className="col-12 no-gutter fluid d-flex p-3">
      <h2 className="logo text-warning">Filimo</h2>
      <>
      <NavLink to="/movieList">Home</NavLink>
      <NavLink to="/">Form</NavLink>
      <NavLink to="/logReg">Sign In</NavLink>
    </>
    </div>
  );
};

export default NavBar;
